import { Link } from "react-router-dom";
const Secciones = () => {
  return (
    <>
      <li className="nav-item">
        <Link className="nav-link" to="/contact"><button className="btn btn-light">Contacto</button></Link>
      </li>
    </>
  );
}

export default Secciones;
